import React from 'react'
import {Nav} from 'react-bootstrap'
import { LinkContainer } from 'react-router-bootstrap'


function CheckoutSteps(step1, step2, step3, step4) {
  return (
    <Nav className="items-center mb-4">
        <Nav.Item>
            {step1 ? (
                <LinkContainer to='/login'>
                <Nav.Link>Zaloguj się</Nav.Link>
            </LinkContainer>
            ): (
                <Nav.Link disabled>Zaloguj się</Nav.Link>
            )}
        </Nav.Item>
        <Nav.Item>
            {step2 ? (
                <LinkContainer to='/shipping'>
                <Nav.Link>Dostawa</Nav.Link>
            </LinkContainer>
            ): (
                <Nav.Link disabled>Dostawa</Nav.Link>
            )}
        </Nav.Item>
        <Nav.Item>
            {step3 ? (
                <LinkContainer to='/payment'>
                <Nav.Link>Płatność</Nav.Link>
            </LinkContainer>
            ): (
                <Nav.Link disabled>Płatność</Nav.Link>
            )}
        </Nav.Item>
        <Nav.Item>
            {step4 ? (
                <LinkContainer to='/placeorder'>
                <Nav.Link>Potwierdź zamówienie</Nav.Link>
            </LinkContainer>
            ): (
                <Nav.Link disabled>Potwierdź zamówienie</Nav.Link>
            )}
        </Nav.Item>







    </Nav>
  )
}

export default CheckoutSteps
